(1459, '_transient_dash_01e18dead815ce736e3b9cccfbd773a5', '<div class="rss-widget"><ul><li><a class=\'rsswidget\' href=\'https://wordpress.org/news/2017/07/the-month-in-wordpress-june-2017/\'>The Month in WordPress: June 2017</a> <span class="rss-date">3 de julho de 2017</span><div class="rssSummary">We’re starting a new regular feature on this blog today. We’d like to keep everyone up-to-date about the happenings all across the WordPress open source project and highlight how you can get involved, so we’ll be posting a roundup of all the major WordPress news at the end of every month. Aside from other general [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=\'rsswidget\' href=\'https://wptavern.com/wpweekly-episode-281-in-memory-of-jesse-petersen\'>WPTavern: WPWeekly Episode 281 – In Memory of Jesse Petersen</a></li><li><a class=\'rsswidget\' href=\'https://wptavern.com/sustain-event-draws-100-attendees-to-discuss-the-sustainability-of-open-source-software\'>WPTavern: Sustain Event Draws 100 Attendees to Discuss the Sustainability of Open Source Software</a></li><li><a class=\'rsswidget\' href=\'https://heropress.com/essays/i-found-myself-in-wordpress/?utm_source=rss&#038;utm_medium=rss&#038;utm_campaign=i-found-myself-in-wordpress\'>HeroPress: How I found myself in WordPress – Как я нашел себя в WordPress</a></li></ul></div><div class="rss-widget"><ul><li class="dashboard-news-plugin"><span>Plugins populares:</span> WooCommerce&nbsp;<a href="plugin-install.php?tab=plugin-information&amp;plugin=woocommerce&amp;_wpnonce=3f453db972&amp;TB_iframe=true&amp;width=600&amp;height=800" class="thickbox open-plugin-details-modal" aria-label="Instalar WooCommerce">(Instalar)</a></li></ul></div>', 'no'),
